import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <nav>
        <ul>
          <li><Link to="/">Inicio</Link></li>
          <li><Link to="/agregar-viaje">Agregar Viaje</Link></li>
          <li><Link to="/consultar-viajes">Consultar Viajes</Link></li>
        </ul>
      </nav>
      <Switch>
        <Route path="/" exact component={Inicio} />
        <Route path="/agregar-viaje" component={AgregarViaje} />
        <Route path="/consultar-viajes" component={ConsultarViajes} />
        <Route path="/modificar-viaje/:id" component={ModificarViaje} />
      </Switch>
    </Router>
  );
};

const Inicio = () => <h1>Bienvenido a la aplicación de viajes</h1>;

const AgregarViaje = () => {
  const [formData, setFormData] = useState({
    pais: '',
    ano: '',
    mes: '',
    duracion: '',
    costo: '',
    kmRecorrido: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await fetch('http://localhost:3003/api/viajes', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formData)
    });
    alert('Viaje agregado');
  };

  return (
    <div>
      <h2>Agregar Viaje</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" name="pais" placeholder="Pais" value={formData.pais} onChange={handleChange} required />
        <input type="number" name="ano" placeholder="Año" value={formData.ano} onChange={handleChange} required />
        <input type="number" name="mes" placeholder="Mes" value={formData.mes} onChange={handleChange} required />
        <input type="number" name="duracion" placeholder="Duración" value={formData.duracion} onChange={handleChange} required />
        <input type="number" name="costo" placeholder="Costo" value={formData.costo} onChange={handleChange} required />
        <input type="number" name="kmRecorrido" placeholder="Kilómetros Recorridos" value={formData.kmRecorrido} onChange={handleChange} required />
        <button type="submit">Agregar Viaje</button>
      </form>
    </div>
  );
};

const ConsultarViajes = () => {
  const [viajes, setViajes] = useState([]);

  useEffect(() => {
    const fetchViajes = async () => {
      const response = await fetch('http://localhost:3003/api/viajes');
      const data = await response.json();
      setViajes(data);
    };
    fetchViajes();
  }, []);

  const eliminarViaje = async (id) => {
    await fetch(`http://localhost:3003/api/viajes/${id}`, {
      method: 'DELETE'
    });
    setViajes(viajes.filter(viaje => viaje.id !== id));
  };

  return (
    <div>
      <h2>Consultar Viajes</h2>
      <table>
        <thead>
          <tr>
            <th>País</th>
            <th>Año</th>
            <th>Mes</th>
            <th>Duración</th>
            <th>Costo</th>
            <th>Km Recorridos</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {viajes.map(viaje => (
            <tr key={viaje.id}>
              <td>{viaje.pais}</td>
              <td>{viaje.ano}</td>
              <td>{viaje.mes}</td>
              <td>{viaje.duracion}</td>
              <td>{viaje.costo}</td>
              <td>{viaje.km_recorrido}</td>
              <td>
                <button onClick={() => eliminarViaje(viaje.id)}>Eliminar</button>
                <Link to={`/modificar-viaje/${viaje.id}`}><button>Modificar</button></Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const ModificarViaje = ({ match }) => {
  const [formData, setFormData] = useState(null);
  const viajeId = match.params.id;

  useEffect(() => {
    const fetchViaje = async () => {
      const response = await fetch(`http://localhost:3003/api/viajes/${viajeId}`);
      const data = await response.json();
      setFormData(data);
    };
    fetchViaje();
  }, [viajeId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await fetch(`http://localhost:3003/api/viajes/${viajeId}`, {
      method: 'PUT',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formData)
    });
    alert('Viaje modificado');
  };

  if (!formData) return <p>Cargando...</p>;

  return (
    <div>
      <h2>Modificar Viaje</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" name="pais" placeholder="Pais" value={formData.pais} onChange={handleChange} required />
        <input type="number" name="ano" placeholder="Año" value={formData.ano} onChange={handleChange} required />
        <input type="number" name="mes" placeholder="Mes" value={formData.mes} onChange={handleChange} required />
        <input type="number" name="duracion" placeholder="Duración" value={formData.duracion} onChange={handleChange} required />
        <input type="number" name="costo" placeholder="Costo" value={formData.costo} onChange={handleChange} required />
        <input type="number" name="kmRecorrido" placeholder="Kilómetros Recorridos" value={formData.kmRecorrido} onChange={handleChange} required />
        <button type="submit">Modificar Viaje</button>
      </form>
    </div>
  );
};

export default App;
